was Prehistoric Earth, the the Ark.. was here! Her comrades in stasis. & She 
would orginially be on Cybertron, hunting down Elita 0ne & the Fembots & 
other Autobots. She would be in her first upgraded form. 

Upgrades... she wanted to get out of this bloody form now. She searched 
internally. Difficult to find but she found it. it was a technology she was 
not very keen with. 

She opened a com back to the ship, to Wheeljack. &quot;Wheeljack. May I remind 
you, that there are metals in the hold.. however, don&#39;t get so greedy with 
them. I will be using them.&quot;

